import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';

class Landing extends Component{
    render(){
        return(
            <div style= {{width:'100%', margin:'auto'}}>
                <Grid className="landing-grid">
                    <Cell col={12}>
                        <img 
                            src="https://www.google.com/search?client=ubuntu&hs=hkD&channel=fs&biw=1537&bih=779&tbm=isch&sa=1&ei=lNLcXb3mLbGblwSir5PoBQ&q=avatar+icon+png+&oq=avatar+icon+png+&gs_l=img.3..0i19l3j0i30i19j0i5i30i19l6.2731.5691..5871...0.0..0.102.375.4j1......0....1..gws-wiz-img.......0i67j0j0i30.M7K6QKAzOQQ&ved=0ahUKEwi9gNnhq4fmAhWxzYUKHaLXBF0Q4dUDCAY&uact=5#imgrc=ABwK89ve818jbM:"
                            alt="avatar"
                            className="avatar-imp"
                        />
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
